      `,trans_examp:[{level:"B1",pos_2:"[ U ]",trans_en:"communication with someone, especially by speaking or writing to them regularly",trans_cn:"（尤指经常通过交谈、书信的）联系，联络，交往",example:[{eg:'"Have you been in contact with Andrew recently?" "Only by phone."',egtrans:"“你最近跟安德鲁联系过吗？”“只是打过电话。”"},{eg:"I'm still in contact with her - we write a couple of times a year.",egtrans:"我和她仍有联系——我们一年写几封信。"},{eg:"There isn't enough contact between teachers and parents.",egtrans:"老师和家长间联系不够。"},{eg:"I've been busy at home and have hardly had any contact with the outside world.",egtrans:"我一直都在家里忙乎，和外面的世界几乎没有什么联系。"},{eg:"I'd hate to lose contact with my college friends.",egtrans:"我不愿和从前的校友失去联系。"},{eg:"She finally made contact with him in Italy.",egtrans:"她最终在意大利和他取得了联系。"},{eg:"Air traffic control lost radio contact with the pilot of the plane ten minutes before the accident.",egtrans:"事故发生前10分钟，空中交通管制中心失去了和飞机驾驶员的无线电联系。"},{eg:"The school needs a contact number (= phone number, especially for emergencies) for parents during school hours.",egtrans:"学校希望有上课时间能联系到家长的电话号码。"}]}],phrase:[]},{name:"contact",pos:"noun",posTip:"A word that refers to a person, place, idea, event or thing.",guideword:`
