      `,trans_examp:[{level:"A1",pos_2:"[ I or T ]",trans_en:"to look at something for a period of time, especially something that is changing or moving",trans_cn:"观看；注视",example:[{eg:"I had dinner and watched TV for a couple of hours.",egtrans:"我吃了饭，然后看了几个小时电视。"},{eg:"He spent the entire afternoon watching a cricket match.",egtrans:"他整个下午都在看一场板球比赛。"},{eg:"I watched him get into a cab.",egtrans:"我看着他坐上一辆出租车。"},{eg:"I got the feeling I was being watched.",egtrans:"我有种被人监视的感觉。"},{eg:"I sit by the window and watch people walking past.",egtrans:"我坐在窗边，看着人来人往。"},{eg:"Just watch how he slides that ball in past the goalkeeper.",egtrans:"看看他是多么巧妙地带球越过守门员而入网的。"},{eg:"Bonner watched helplessly as they drove away without him.",egtrans:"邦纳无助地看着他们开着车扬长而去，没有带上他。"},{eg:"She'll pretend that she hasn't seen us - you watch.",egtrans:"她会假装没看见我们的——你看着吧。"}]},{level:"",pos_2:"[ T ]",trans_en:"to stay with someone or something, such as a child, for a short time to make certain that he, she, or it is safe",trans_cn:"看护；照看",example:[{eg:"If you want me to watch the kids for a couple of hours while you go out, just let me know.",egtrans:"如果你想在出门时让我帮忙照看孩子们几个小时，跟我说一声就行了。"},{eg:"Could you watch my bags for me, while I go to the toilet?",egtrans:"我去一趟卫生间，你帮我看一下这些包好吗？"}]}],phrase:[]},{name:"watch",pos:"verb",posTip:"A word that describes an action, condition or experience.",guideword:`
