      `,trans_examp:[{level:"A2",pos_2:"[ C ]",trans_en:"a route, direction, or path",trans_cn:"路，道路；路线",example:[{eg:"Do you know the way to the restaurant?",egtrans:"你知道去餐馆怎么走吗？"},{eg:"I've only been living in Madrid for a couple of weeks so I don't really know my way around it yet.",egtrans:"我只在马德里住了几个星期，所以还不太认识周围的路。"},{eg:"We'll have to stop for petrol on the way to the airport.",egtrans:"我们得在去机场的路上停下来加油。"},{eg:"Can you find your own way out of the building?",egtrans:"你自己能找对路走出这栋楼吗？"},{eg:"He elbowed/pushed his way (= hit/pushed people so that he could go past them) to the front of the crowd.",egtrans:"他用胳膊肘／手推搡出一条路，挤到了人群前面。"},{eg:"The bus stopped for us to eat lunch but within half an hour we were on our way/under way (= travelling) again.",egtrans:"长途汽车停下来让我们吃午饭，不过不到半小时，我们又上路了。"},{eg:"There's no way through here - you'll have to go round.",egtrans:"这里没有路通过去——你们得绕行。"},{eg:"They flew from Los Angeles to Toronto by way of Chicago.",egtrans:"他们途径芝加哥从拉斯维加斯飞到多伦多。"},{eg:"Many people have lost their way (= become lost) in the forest.",egtrans:"很多人在森林里迷了路。"},{eg:"Only local people could find their way through the maze of narrow streets.",egtrans:"只有本地人才能在迷宫般的狭窄街道中找到路。"}]},{level:"B1",pos_2:"[ C ]",trans_en:"used to talk about the direction in which something is facing",trans_cn:"（某物面对的）方向",example:[{eg:'"Which way does the room face?" "North."',egtrans:"“这个房间朝哪个方向？”“朝北。”"},{eg:"Which way up should this box be? (= Which side should be on top?)",egtrans:"这个箱子应该哪一面朝上？"},{eg:"The numbers are the wrong way round - it should be 71, not 17.",egtrans:"那个数字颠倒了——应该是71，不是17。"}]}],phrase:[{phrase_title:"make your way",dsense_body_def_block_kk:[{def_info:{epp_xref:"B2",gram:""},def:"to travel or move to a place",ddef_b_trans:"去往；搬到（某处）",example:[{eg:"We slowly made our way down the river.",egtrans:"我们慢慢地沿河而下。"},{eg:"It's getting late - we should make our way home soon.",egtrans:"天晚了——我们应该动身回家了。"}]}]},{phrase_title:"the other way round/around",dsense_body_def_block_kk:[{def_info:{epp_xref:"B2",gram:""},def:"happening in the opposite way",ddef_b_trans:"相反地，倒过来，以相反方式",example:[{eg:"I thought the older people would be more offended than the young people, but it was the other way round.",egtrans:"我以为那位老人会比年轻人更加生气，结果情况恰恰相反。"}]}]},{phrase_title:"the other way around",dsense_body_def_block_kk:[{def_info:{epp_xref:"B2",gram:""},def:"happening in the opposite way",ddef_b_trans:"相反地，倒过来，以相反方式",example:[{eg:"I thought the older people would be more offended than the young people, but it was the other way around.",egtrans:"我以为那位老人会比年轻人更加生气，结果情况恰恰相反。"}]}]},{phrase_title:"Way",dsense_body_def_block_kk:[{def_info:{epp_xref:"",gram:""},def:"used in the names of some roads",ddef_b_trans:"…路（用于道路的名称）",example:[{eg:"Our offices are at 17 King's Way.",egtrans:"我们的办事处在国王路17号。"}]}]}]},{name:"way",pos:"noun",posTip:"A word that refers to a person, place, idea, event or thing.",guideword:`
